import React from 'react'
import HomeIcon from '@material-ui/icons/Home';

export const SidebarData = [
    {
        title: "Statistics",
        icon: <HomeIcon/>,
        url: "/statistics",
    },
    {
        title: "Team management",
        icon: <HomeIcon/>,
        url: "/team",
    },
    {
        title: "Patch notes",
        icon: <HomeIcon/>,
        url: "/https://euw.leagueoflegends.com/fr-fr/news/tags/patch-notes",
    },
    {
        title: "Champions",
        icon: <HomeIcon/>,
        url: '/champions'
    },
    {
        title: "E-sport",
        icon: <HomeIcon/>,
        url: "https://lolesports.com/",
    },
]
